import ReactDOM from 'react-dom';
import './index.css';
import React, { Component } from 'react';
import Item from './Item';

class ItemParent extends Component {
  constructor(props, context) {
    super(props, context);
    this.state = {
      numTries: 0,
      sucTries: 0,
      overlapsBin: false,
    };
  }
  setOverlapsBin() {
    this.setState({ overlapsBin: true, });
  }
  render() {
    let item;
    if (this.state.overlapsBin == false) {
      item = <Item bin={this.props.bin} itemnumber={this.props.itemnumber} itemtype={this.props.itemtype} />;
    }

    return (
      <div>
        {item}
      </div>
    );
  }
}

export default ItemParent;
